import math from './resources/math.png';
import science from './resources/science.png';
import accomplishments from './resources/accomplishments.png';
import React from 'react';
import { withRouter } from "react-router-dom";
import "./Header.css";
import home from './resources/home.png';
class Image extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <img class="Image" src={this.props.name} onClick={this.props.history.push(this.props.path)}></img>
        );
    }
}
class Header extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div className="Header">
                <Image history = {this.props.history} name={home} path="/About"></Image>
                <Image history = {this.props.history} name={math} path="/Math"></Image>
                <Image history = {this.props.history} name={science} path="/Science"></Image>
                <Image history = {this.props.history} name={accomplishments} path="/Accomplishments"></Image>
            </div>
        )
    }
}
export default withRouter(Header);
